const ipfsWriteConfig = {
    host: 'localhost',
    port: '5001',
    protocol: 'http'
};

const ipfsReadConfig = {
    host: 'localhost',
    port: '8080',
    protocol: 'http'
};
//ipfsUrlBefore 连接上 hash 就可以直接用来读取了
const ipfsReadUrlBefore = ipfsReadConfig.protocol + "://" + ipfsReadConfig.host + ":" + ipfsReadConfig.port + "/ipfs/";

//导出多个模块，要用一个语句，不能分别导出
module.exports = { ipfsWriteConfig, ipfsReadUrlBefore }
